// Filename: App.js
import './App.css';
import Navbar from './components/Navbar';
import { SearchBar } from './components/SearchBar';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return ( 
    <div className="App">
      <Navbar/>
      <Router>
        <Switch>
          <Route path="/my_groups">
            <h1>My groups</h1>
          </Route>
          <Route path="/settings">
            <h1>Settings</h1>
          </Route>
          <Route path="/groups">
            <h1>Groups</h1>
          </Route>
          <Route path="/">
            <h1>Home</h1>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}
export default App;
